    render() {
        return(<div><TableHead/><TableData/></div>)
    }

}

class TableData extends React.Component {


    constructor() {
        super();
        this.state = {
            data: [],

            setPreview: function (index, data) {
                this.data[index] = data;
            },

            getPreview: function () {
                return this.data;
            }
        };
        this.setStateHandler = this.setStateHandler.bind(this);

    }

     setStateHandler() {
         alert()

     }

     render() {
         return (<div><input type="text" id="text"/><input type="button" value="state" onClick={this.setStateHandler}/><div>{3}</div></div>)
     }
}
TableData.defaultProps={

    tool:"Dagger",
    vehicle:"Amore"
}


class TableHead extends React.Component{

    render() {
        return(<div><tbody><tr><th>Head</th><th>Nose</th></tr></tbody></div>);
    }

}
